import React from 'react';
import WatchOurVideo from './WatchOurVideo'
import BookSession from './BookSession'
import FullScreenInfo from '../FullScreenInfo'

import ProrideImg1 from '../../static/images/proride-kids-1.png'
import ProrideImg2 from '../../static/images/proride-kids-2.png'

// const removeSpaces = (str) => {
//   return str.replace(/[()\s+]/g,'')
// }

function Home() {
  return (
    <div>
      <FullScreenInfo classes="blue-gradient full-screen-info" title="ProRide Coaching" description="Making cycling in school fun" buttonText="" imageDescription="phil bateman coaching in schools" imageSrc={ProrideImg1} />
      <FullScreenInfo classes="green-gradient full-screen-info" title="View Our Range Of Services" buttonText="Learn More" imageDescription="Range of services" imageSrc={ProrideImg2} />

      <div class='home-divider'>
        <div class='row'>
          <div class='column'>
            <div class='video-div'>
             <WatchOurVideo />
            </div>
          </div>
          <div class='column'>
            <div class='book-session-div'>
             <BookSession />
            </div>
          </div>
        </div>
      </div>

    </div>
  );
}

export default Home;
